var movies = movieString.split("linebrk");


//returns the URL that the movie API needs
var url1 = "http://www.omdbapi.com/?t=";
var url2 = "&y=&plot=short&r=json&callback=?&tomatoes=true";
var getUrl = function(movie){
    return url1 + movie + url2;
}; 


//The movie objects that are going to be entered into the database
var movie = function(title, year, rated, runtime, imdbRating, tomatoMeter, tomatoConsensus, genre, director, actors, metascore, poster, type, avg, website, plot){
    this.title = title;
    this.year = year;
    this.rated = rated;
    this.runtime = runtime;
    this.imdbRating = imdbRating;
    this.tomatoMeter = tomatoMeter;
    this.tomatoConsensus = tomatoConsensus;
    this.genre = genre;
    this.director = director;
    this.actors = actors;
    this.metascore = metascore;
    this.poster = poster;
    this.type = type;
    this.avg = avg;
    this.website = website;
    this.plot = plot;
}; 
var objects = [];


// title, year, released, runtime, genre, director, actors, imdbRating
//Gets all the API data needed EXCEPT for thumbnail image. THe thumbnail image returned by the omdB database is invalid. 
var getApi = function(){
    for(i=0; i<movies.length; i++){
        var url = getUrl(movies[i]);
        if(movies[i] === movies[i-1]){
            console.log("duplicate");
        } else{
        $.getJSON(url,
                function(json){   
                	if(json.Title == null){
                		console.log("movie is null");;
                	}else{
                		objects.push( new movie(json.Title, json.Year, json.Rated, json.Runtime, json.imdbRating, json.tomatoMeter, json.tomatoConsensus, json.Genre, json.Director, json.Actors, json.Metascore, json.Poster, json.Type, "0", json.Website, json.Plot));

                	}       
    });}
    }
};  


